let short = products.sort(function(a,b){
return b.price - a.price
});
let all = short.reduce(function(acc,value){
return acc + value.price
},0);

localStorage.setItem("result",JSON.stringify(short));
let finalresult = JSON.parse(localStorage.getItem("result"));

let aman = document.querySelector(".aman");

finalresult.forEach(function(dels){
    let card = document.createElement("div");
    card.classList = ("card");
    card.innerHTML = `<div class="info">
    <span class="name">${dels.name}</span><br>
    <img src="${dels.image}"></img><br>
    <span class="price">Price :${dels.price}</span><br>
    <br>
    <div class="btns"><button class="btn1">Buy Now</button><button class="btn2">Add to Card</button></div>
    `
    aman.appendChild(card);
});

let inp = document.querySelector("#inp");
inp.addEventListener("keyup",function(){
    let search = inp.value.toLowerCase()
let bod = document.querySelectorAll(".card");
bod.forEach(function(dels){
    let data = dels.textContent.toLowerCase();
    if(data.includes(search)){
        dels.style.display = ""
    }else{
            dels.style.display = "none"

    }
})

});
let btn = document.querySelector("#btn")
btn.addEventListener("click",function(dels){
    inp.value = "";
    let bod = document.querySelectorAll(".card");
    bod.forEach(function(dels){
        dels.style.display = ""
    })
});






let cart = [];

let carticon = document.querySelector(".fa-cart-shopping");
let cartcount = document.createElement("span");
cartcount.style.background = "white"
cartcount.style.color = "black"
cartcount.style.borderRadius = "50%"
cartcount.style.padding = "2px 6px"
cartcount.style.fontSize = "12px"
cartcount.style.marginLeft = "5px"
cartcount.textContent = "0"
carticon.appendChild(cartcount);

let addBtns = document.querySelectorAll(".btn2");
addBtns.forEach(function(btn,index){
    btn.addEventListener("click",function(){
        let select = finalresult[index];
    cart.push(select);
    cartcount.textContent = cart.length
    alert(`${select.name} Added to card`)

    })
})
localStorage.setItem("cart",JSON.stringify(cart))
let cartitem = JSON.parse(localStorage.getItem("cart"));
cartitem.push(cart);


